
public class InnerForLoop {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		//outer for
		for(int i=10;i<=14;i++) {///14
			System.out.print(i+"= ");
			//inner for 
			for(int j=1;j<=5;j++) {
				System.out.print(j+" ");
				
				
			}
			System.out.println();
		}

	}

}
